import React from 'react';
import { NavLink } from 'react-router-dom';

import './NavBar.css';

const navBar = props => {
  return (
    <div className='NavBar'>
        <NavLink to='/'>Home</NavLink>
        <li><NavLink to='/crisps'>Crisps</NavLink></li>
        <li><NavLink to='/chocolate'>Chocolate</NavLink></li>
        <li><NavLink to='/lollipop'>Lollipop</NavLink></li>
    </div>
  )
}

export default navBar;
